use feature 'say';

my $i = '';

my @in = split(//,$i);

sub findIt {
    my $chars = shift;

    for( my $i = 0; $i < @$chars - 1; $i++ ) {
        
        my $uc1 = uc($chars->[$i]);
        my $uc2 = uc($chars->[$i+1]);

        if( $uc1 eq $uc2 && $chars->[$i] ne $chars->[$i+1] ) {
            say "$uc1 $uc2 ".$chars->[$i]." ". $chars->[$i+1];
            splice(@$chars,$i,2);
            return 1;
        }
    }
    say 'returning 0';
    return 0;
}

my $found = 1;
while($found) {
   $found = findIt(\@in);
}

say scalar(@in);
exit 0;

while( $i =~ /([A-Za-z])(\1)/i) { 
    my $c1 = $1;
    my $c2 = $2;

    if( uc($c1) eq uc($c2) && $c1 ne $c2 ) {
        $i =~ s/$c1$c2//g;
    }
}

say length($i);

exit 0;